script: |
  super -f text -I q13100.spq | sort > q13100.out

inputs:
  - name: q13100.spq
    data: |
      SELECT ALL - col0 - col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN + 8 AND + ( - CAST ( col0 AS INTEGER ) ) / 17;
  - name: tab0

outputs:
  - name: q13100.out
    data: |
